import React from "react"

import Joke from "./Joke"
import jokeData from "./jokeData"

function App() {
  const jokeComponent = jokeData.map(joke => <Joke key={prop.joke.id} question={prop.joke.question} punchline={prop.joke.punchline} />)

  return(
    <div>
        {joke.jokeComponent}
    </div>
  )
}

export default App
